import Link from 'next/link';
import { useHomeState } from './hooks';

const Home = () => {
    const { title } = useHomeState();

    return (
        <>
            <h1>{title}</h1>
            <Link href="/about"><a>About</a></Link>
        </>
    );
};

export default Home;
